window.bookSummaryJSON = "<p>Includes audio exclusive of <i>Burn in Darkness</i> narrated by Troy Duran!</p> <p>The worst has happened. Kaito says this can be fixed. But I don't know if I have any fight left in me anymore.</p> <p>For their sake, I better get my shit together. We've come this far, and my Virtues and I have been through life and death together.</p> <p>Nothing has changed.</p> <p>Nothing except Lucifer coming down on me with his fallen angel army. My Virtues who are still on earth are forced to bend to his control. And now the next Echo of Calamity is on its way, overlapping with a mission that I've yet to fulfill.</p> <p>And now a new ally has joined our ranks. Balthazar has a trick up his sleeve, one that's going to change the fabric of the universe.</p> <p>But I'll do anything for my Virtues, even if I have to rip the worlds apart.</p>"; 
